import { Route, Switch } from "react-router-dom";
import AllQuotes from "./pages/AllQuotos";
import NewQuote from "./pages/NewQuote";
import QuateDetail from "./pages/QuoteDetail";

function App() {
  return (
    <div>
      <Switch>
        <Route path="/quotes">
          <AllQuotes />
        </Route>
        <Route path="/quotes/:quoteId">
          <QuateDetail />
        </Route>
      </Switch>
      <Route path="/new-quote">
        <NewQuote />
      </Route>
    </div>
  );
}

export default App;
